import React from 'react';
import "./Home.css";

function Home() {
  return (
    <div className="homepage">
        <img className='image1' src="../Utils/Images/bsphcllogo" alt="bsphcl"></img>
        <h1>Bihar State Power (Holding) Company Limited</h1>
        <p>Hamara Aadhaar... Urjasvit Bihar</p>
        <img className="image2" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTD7tQCt98RgXQydppt2EPT6yoxRWYzxPSqfCFYUjJbnzQgphE8SJIS-44eTQyU48Tp4yw&usqp=CAU" alt="bihar_govt"></img>

    </div>
  )
}

export default Home;
